"""
Create User-Agentini adalah Random User-Agent Generator yang dibuat untuk menghasilkan user-agent secara acak dan unik dari berbagai browser seperti Chrome, Firefox, Edge, Safari, Opera, dan lainnya. Fitur-fitur utamanya meliputi:
Variasi Browser: Menghasilkan user-agent dari berbagai platform dan browser agar hasilnya bermacam-macam.
Unik & Valid: Setiap user-agent yang dihasilkan dijamin unik dan valid, cocok buat keperluan testing, scraping, atau bypass filter.
Tampilan Keren: Menggunakan modul rich untuk tampilan interaktif dan pyfiglet untuk header dengan style yang canggih.
Opsi Simpan: Pengguna bisa memilih untuk langsung menyimpan hasilnya ke file atau menampilkannya di layar.
User-Friendly: Input interaktif yang membuat penggunaan script jadi mudah dan cepat tanpa perlu repot menunggu output yang berlebihan.

Script ini cocok untuk kamu yang butuh variasi user-agent yang valid dan berbeda setiap kali, baik untuk keperluan eksplorasi, testing web, atau studi keamanan siber secara etis.
"""
